import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import { CardProvider } from './context/CardContext'; // Importing the CardProvider component

// Rendering the App component wrapped in the CardProvider
ReactDOM.render(
  <CardProvider> {/* Wrapping the App component with the CardProvider */}
    <App /> {/* The main App component */}
  </CardProvider>,
  document.getElementById('root') // Mounting the rendered component to the HTML element with the ID 'root'
);
